"    Foods contraindicated during therapeutic use of monoamine oxidase inhibitors",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Foods",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Absolutely restricted:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Aged cheeses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Aged and cured meats",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Improperly stored or spoiled meats, fish, or poultry",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Banana peel; broad bean pods",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Marmite",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Sauerkraut",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Soy sauce and other soy condiments",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Draft beer",
"      </td>",
"     </tr>",
"     <tr>",
