var title_f26_39_27260="Language delay red flags";
var content_f26_39_27260=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F60203&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F60203&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Red flags* for language delay",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Age",
"       </td>",
"       <td class=\"subtitle1\">",
"        Red flag",
"       </td>",
"       <td class=\"subtitle1\">",
"        Type of skill",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Birth or any age",
"       </td>",
"       <td>",
"        Does not respond to sounds, particularly parent's voice",
"       </td>",
"       <td>",
"        Receptive language",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        6 to 9 months",
"       </td>",
"       <td>",
"        Does not babble",
"       </td>",
"       <td>",
"        Expressive language",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        12 months",
"       </td>",
"       <td>",
"        Does not use \"mama\" or \"dada\" to call parent",
"       </td>",
"       <td>",
"        Expressive language",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        15 months",
"       </td>",
"       <td>",
"        Does not use specific single word or word approximation other than \"mama\" or \"dada\" to request or comment",
"       </td>",
"       <td>",
"        Expressive language",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Does not use a point to request something out of reach",
"       </td>",
"       <td>",
"        Gestural communication",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        18 months",
"       </td>",
"       <td>",
"        Does not have at least five words used spontaneously to make requests or to comment on or label objects (assessed by asking: \"How does she let you know what she wants?\" or \"What words does she use to ask for things?\")",
"       </td>",
"       <td>",
"        Expressive language",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Does not follow familiar one-step direction without gesture",
"       </td>",
"       <td>",
"        Receptive language",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Does not point to something in order to share enjoyment or excitement with another person (joint attention)",
"       </td>",
"       <td>",
"        Gestural communication",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        24 months",
"       </td>",
"       <td>",
"        Uses fewer than 50 words",
"       </td>",
"       <td>",
"        Expressive language",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Does not combine two words together to create new meaning. (See caution below.)&bull;",
"       </td>",
"       <td>",
"        Expressive language",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Typically the age at which 90 percent of typically developing children have attained the skill.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Parents may report",
"      <strong>",
"       stock phrases",
"      </strong>",
"      (eg, \"let's go,\" \"all done,\" \"good job\") or",
"      <strong>",
"       compound nouns",
"      </strong>",
"      (\"dump truck,\" \"Tyrannosaurus rex,\" \"baby doll\") as examples of this skill.",
"      <strong>",
"       These do not count as novel two-word combinations",
"      </strong>",
"      . Ask parents for specific examples, and probe further if these types of examples are the only ones provided.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
