var title_f26_39_27262="FEC plus paclitaxel for MBC";
var content_f26_39_27262=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F86825&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F86825&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Sequential fluorouracil, epirubicin, and cyclophosphamide (FEC) followed by weekly paclitaxel for metastatic breast cancer",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle/course length: 21 days (FEC), 7 days (paclitaxel).",
"        <br/>",
"        Duration of therapy: 4 cycles (FEC), 8 weeks (paclitaxel).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Cycles 1 through 4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fluorouracil",
"       </td>",
"       <td>",
"        600 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Drug is available in 50 mg/mL solution that needs no further dilution prior to administration as slow IV push over five minutes.",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Epirubicin",
"       </td>",
"       <td>",
"        90 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Administer as an IV push into a free flowing IV solution with normal saline (NS) or 5 percent dextrose (D5W), generally over 3 to 20 minutes. May dilute in NS or D5W and infuse over 30 to 60 minutes.",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cyclophosphamide",
"       </td>",
"       <td>",
"        600 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute with 250 mL NS or D5W and administer over 30 to 60 minutes.",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Cycles 5 through 12",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Paclitaxel",
"       </td>",
"       <td>",
"        100 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute in 250 mL NS* and administer over one hour; special tubing needed",
"        <sup>",
"         &Delta;",
"        </sup>",
"        .",
"       </td>",
"       <td>",
"        Weekly for 8 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hydration:",
"        </strong>",
"        Patients should maintain adequate oral hydration (2 to 3 L/day during administration and for one to two days after) and void frequently to reduce the risk of hemorrhagic cystitis",
"        <sup>",
"         [2]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        The emesis risk with FEC is HIGH (&gt;90 percent frequency of emesis). The emesis risk with paclitaxel monotherapy is LOW (10 to 30 percent frequency of emesis). Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        Premedicate with dexamethasone plus both an H1 and an H2 receptor antagonist prior to paclitaxel administration",
"        <sup>",
"         [3]",
"        </sup>",
"        . Refer to UpToDate topic on \"Infusion reactions to systemic chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Epirubicin is a vesicant; avoid extravasation",
"        <sup>",
"         [4]",
"        </sup>",
"        . Paclitaxel can cause significant tissue damage; avoid extravasation",
"        <sup>",
"         [3]",
"        </sup>",
"        . Fluorouracil and cyclophosphamide are irritants. Refer to UpToDate topic on \"Chemotherapy extravasation injury\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Primary prophylaxis with G-CSF is not indicated",
"        <sup>",
"         [1]",
"        </sup>",
"        . Refer to UpToDate topic on \"Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        A lower starting dose of paclitaxel may be needed in patients with liver impairment. A lower starting dose of fluorouracil may be needed for patients with liver impairment, dihydropyrimidine dehydrogenase (DPD) deficiency, or renal impairment. A lower starting dose of cyclophosphamide may be needed in patients with renal impairment. A lower starting dose of epirubicin may be needed in patients with renal or hepatic impairment. Refer UpToDate topics on \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\" and \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Cardiac issues:",
"        </strong>",
"        Epirubicin is associated with dose-dependent cardiomyopathy, the incidence of which is related to cumulative dose. Assess baseline left ventricular ejection fraction (LVEF) prior to initiating therapy. Epirubicin is contraindicated for patients with recent myocardial infarction, severe myocardial dysfunction, severe arrhythmias, or prior treatment with maximum cumulative doses of anthracyclines. Refer to UpToDate topic on \"Cardiotoxicity of anthracycline-like chemotherapy agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess liver and renal function tests prior to each treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess CBC with differential prior to and during each treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for diarrhea and cutaneous toxicity (palmar-plantar erythrodysesthesias).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess changes in neurologic function prior to each treatment with paclitaxel.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor cumulative epirubicin dose. Reassess LVEF periodically during therapy as clinically indicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity",
"        <sup>",
"         &loz;",
"        </sup>",
"        :",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        If the ANC &le;1500 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        or platelets &le;75,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        on day 1 of each cycle, therapy should be delayed until counts recover. For grade 3 clinically relevant toxicity during treatment, reduce doses of all drugs by 25 percent",
"        <sup>",
"         [1]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Gastrointestinal toxicity:",
"        </strong>",
"        Hold fluorouracil for grade 3 diarrhea or mucositis until recovery to &le;grade 1. Upon recovery, reduce fluorouracil dose by 25 percent",
"        <sup>",
"         [1]",
"        </sup>",
"        . Discontinue therapy for grade 4 gastrointestinal (or other non-hematologic) toxicity",
"        <sup>",
"         [1]",
"        </sup>",
"        .",
"        <strong>",
"         NOTE:",
"        </strong>",
"        Severe diarrhea and mucositis after fluorouracil should prompt evaluation for dihydropyrimidine dehydrogenase deficiency. Refer to UpToDate topic on \"Enterotoxicity of chemotherapeutic agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Neurotoxicity:",
"        </strong>",
"        For grade 2 or higher peripheral neuropathy reduce paclitaxel doses by 20 percent",
"        <sup>",
"         [3]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Cardiac toxicity:",
"        </strong>",
"        Discontinue therapy for any clinically significant adverse cardiac events",
"        <sup>",
"         [1]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, doses should be recalculated.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     ANC: absolute neutrophil count; CBC: complete blood count; G-CSF: granulocyte-colony stimulating factor; IV: intravenous; ULN: upper limit of normal.",
"     <br>",
"      * Diluent solutions should not be modified without consulting a detailed reference due to potential incompatibility(ies).",
"      <br>",
"       &Delta; Paclitaxel can be administered in NS, D5W, or NS/D5W at varying concentrations between 0.3 to 1.2 mg/mL. Use glass or polypropylene bottles or polypropylene or polyolefin plastic bags, and administer through polyethylene-lined administration sets with a microporous membrane 0.22 microns or less.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        For any clinically relevant grade 3 toxicity, consider reducing the dose of all drugs by 25 percent, and discontinue therapy for any nonhematologic grade 4 toxicity",
"        <sup>",
"         [1]",
"        </sup>",
"        .",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Martin M, et al. J Nat Cancer Inst 2008; 100:805.",
"      </li>",
"      <li>",
"       Cytoxan (cyclophosphamide) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at: dailymed.nlm.nih.gov, accessed on February 24, 2012).",
"      </li>",
"      <li>",
"       Taxol (paclitaxel) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine.  (Available online at: dailymed.nlm.nih.gov, accessed on February 24, 2012).",
"      </li>",
"      <li>",
"       Ellence (epirubicin hydrochloride) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on February 24, 2012).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
